import Card from './App/Components/Card';
import Nav from './App/Components/Nav';


function App() {
  return (
    <div className="App">
      <Nav/>
      <div className='card'>
      <Card user={"Project Complete"}/>
      <Card user={"Running Projects"}/>
      <Card user={"Pipeline Projects"}/>
      <Card user={"Support Required"}/>
    </div>
    </div>
  );
}

export default App;
